import React, { Component } from "react";
import Title from "./title";

class Services extends Component {
    state = {
        icon: <i className="fa fa-home"></i>,
        title: "free cocktails",
        info:""
    }
  render() {
      return <Title title="services" />;
      
  }
}

export default Services;
